Blockly.Blocks.drive_speed = {
  init: function () {
    this.jsonInit({
      id: "drive_speed",
      message0: "%1 %2",
      args0: [
        {
          type: "field_image",
          src:
            Blockly.mainWorkspace.options.pathToMedia +
            "edison/drive_speed_3.svg",
          width: 40,
          height: 40,
          alt: "Wait",
        },
        { type: "input_value", name: "CHOICE" },
      ],
      inputsInline: !0,
      previousStatement: null,
      nextStatement: null,
      colour: Blockly.Colours.motion.primary,
      colourSecondary: Blockly.Colours.motion.secondary,
      colourTertiary: Blockly.Colours.motion.tertiary,
    });
  },
  onchange: function (a) {
    if (
      (a.type == Blockly.Events.CHANGE &&
        this.childBlocks_[0].id == a.blockId) ||
      (a.type == Blockly.Events.CREATE && -1 != a.ids.indexOf(this.id))
    )
      (a = this.childBlocks_[0].inputList[0].fieldRow[0].value_),
        "1" == a
          ? this.setTooltip(Blockly.Msg.TOOLTIP_DRIVE_SPEED_1)
          : "5" == a
          ? this.setTooltip(Blockly.Msg.TOOLTIP_DRIVE_SPEED_2)
          : "10" == a && this.setTooltip(Blockly.Msg.TOOLTIP_DRIVE_SPEED_3);
  },
};

